import HeroSection from './HeroSection/HeroSection';
import VivoChatSection from './VivoChatSection/VivoChatSection';

const HomePage = () => {
	return (
		<div>
			<HeroSection />
			<div className="row">
				<div className="column-55">
					<VivoChatSection />
				</div>
				<div className="column-45" style={{ background: 'red', height: '200px' }}></div>
			</div>
		</div>
	);
};

export default HomePage;
